v1 (data, context) {
  var partMsg = function(target, value) {
    if (value == -1) return target + ' 🚫';
    return target + ' ' + value + 's';
  }
  var msg = '';
  if (!data.IsEnabled)
    return '🚫';
  msg = '✅ - ';
  msg += partMsg('Users', data.Duration);
  msg += ', ' + partMsg('Reg', data.DurationUsers);
  msg += ', ' + partMsg('Editors', data.DurationEditors);
  msg += ', ' + partMsg('SysAdmins', data.DurationSystemAdmin);
  return msg;
}

v1(data, context) {
  if (context.cache.alreadyRun) return data.value;
  context.cache.alreadyRun = true;
  const enabled = context.features.isEnabled('LightSpeedOutputCache');
  // console.log("enabled", enabled);
  return !enabled;
}

v1(data, context) {
  const t = data.TargetType;
  return t == 2 || t == 4 || t == 10;
}

v1 (data, context) {
  const empty = 'empty';
  const len = 30;
  // Remove HTML in note
  const noHtml = data.Note.replace(/<\/?[^>]+(>|$)/g, ' ');
  if (!noHtml || noHtml == ' ') return empty;

  // remove html things like &nbsp;
  const converterTextArea = context.cache.converter 
    || document.createElement("textarea");
  converterTextArea.innerHTML = noHtml;
  const cleanText = converterTextArea.value;

  // Trim multiple spaces, created by multiple tags
  var final = cleanText.replace(/\s+/g, ' ').trim();

  if (!final) return empty;

  if (final.length > len) final = final.substring(0, len) + "..."
  return final || empty;
}
